import React from "react";
import "./App.css";
import NavBar from "./NavBar/NavBar";
import Weather from "./Weather/Weather";

const App = () => {
  return (
    <>
      <section className="navigation">
        <NavBar />
      </section>
      <section className="main">
        <Weather />
      </section>
    </>
  );
};
export default App;
